import styled from "styled-components";

const Top = styled.div`
    background-color: white;
    display: flex;
`
const Logo = styled.div`
`

export default function TopLayout(){
    return(
        <>
            <Top>
                <Logo><Link to="/">메인 이미지</Link></Logo>
                <Profile>프로필</Profile>
                <Like>좋아요</Like>
                <Chat>채팅</Chat>
            </Top>
            <Outlet/>
        </>
    );
}
